import React from 'react'
import { connect } from 'react-redux'


function DashboardConfig(props) {
    const [open, setOpen] = React.useState(false);

    const input = () => {
        if(open === true)
        return (
            <div>
            <label>test</label>
            <input>
            </input>
            </div>
        )
    }
        const listStyle = {
            listStyle: 'none',
        }
        const listElementStyle = {
            paddingTop: '1rem'
        }
        const user  = console.log(props.auth, 'test');
        return(
            <div>
                <p>Modify user informations :</p>
                <ul style={listStyle}>
                    <li style={listElementStyle}>
                        Name
                    </li>
                    {input()}
                    <li style={listElementStyle}>
                        Surname
                    </li>
                    <li style={listElementStyle}>
                        Phone
                    </li>
                    <li style={listElementStyle}>
                        Address
                    </li>
                </ul>
            </div>
        )
    }


const mapStateToProps = state => ({
    auth: state.auth
  });

export default connect(mapStateToProps)(DashboardConfig);
